import React, { useState, useEffect } from "react";
import EachListItem from "./EachListItem";
import NavBar from "./NavBar";



export default function ItemsPage(props) {
  const [catalogList, setCatalogName] = useState([
      {
          type:"shirt",
          imgSrc:"https://i.pinimg.com/564x/04/bb/21/04bb2164bbfa3684118a442c17d086bf.jpg",
          tittle:"stam item" , 
          price:10,
          description:"bla bla bla"}]);
  useEffect(() => {
    let temp =/*props.arrItems*/catalogList.filter(item =>{
      return item.type === "shirt"/* props.type*/;
    })
    setCatalogName(temp);
  },[]);
  return (
    <div>
      <NavBar Page="MainPageAfterLogin" toLink="/MainPage"/>
     
      <ul>{catalogList.map(e=>{
        return  <EachListItem  Item={e} />
      })}</ul>
    </div>
  );
}
